import "./Seller.css"

function Seller(){
return(
    <div className='container-fluid grid gap-10 px-5 grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4'>
    <div className="card" style={{width: 18,rem}}>
    <div className="card-body">
      <h5 className="card-title">Seller Name</h5>
      <p className="card-text">Seller Description</p>
      <a href="#" className="btn btn-primary">Location</a>
    </div>
  </div>
    </div>
    );
}
export default Seller;
